import React from 'react';
import { Link } from 'react-router-dom';


const Cards = () => {



  const cardsData = [
    { id: 1, frontContent: `L.I.F.E.'s Alternative: L.E.A.D. (Let Everyone Advance with Dignity) Diversion Program`, sectionId:'program-3'},
    { id: 2, frontContent: 'Back2LIFE Reintegration & Transition Support Program', sectionId: 'program-1' },
    { id: 3, frontContent: '1Life2Live Gun & Gang Violence Prevention & Intervention Program', sectionId: 'program-2' }
  ];

  return(
  <div class='flex justify-between'>
    <h3>Our Programs</h3>
  {cardsData.map(card => (
      <Link to={`/programs#${card.sectionId}`} class="block max-w-sm p-6 bg-white border border-gray-200 rounded-lg shadow hover:bg-gray-100 bg-ylsnRed dark:border-gray-700 dark:hover:bg-gray-700">
        <h5 class="mb-2 text-2xl font-bold tracking-tight text-gray-900 dark:text-white">{card.frontContent}</h5>
        <p class="font-normal text-gray-700 dark:text-gray-400">Here are the biggest enterprise technology acquisitions of 2021 so far, in reverse chronological order.</p>
      </Link>
    ))}
  </div>)

;
}

export default Cards;
